function Header() {
  return (
    <header>
        <nav>
            <ul className="header-links">
                <li className="header-button"><a></a>Home</li>
                <li className="header-button">Predmeti</li>
                <li className="header-button">Galerija</li>
                <li className="header-button">Music Visualizer</li>
                <li className="header-button">upcoming Testi</li>
                <li className="header-button change-to-light">Light</li>
            </ul>
        </nav>
    </header>

  );
}

export default Header;
